<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>üíï A Special Question for Nidhi üíï</title>
<style>
  @import url('https://fonts.googleapis.com/css2?family=Dancing+Script:wght@400;700&family=Permanent+Marker&family=Caveat:wght@400;700&family=Pacifico&display=swap');

  * { margin: 0; padding: 0; box-sizing: border-box; }

  body {
    width: 100vw;
    height: 100vh;
    overflow: hidden;
    font-family: 'Dancing Script', cursive;
    background: linear-gradient(135deg, #1a0a0a, #2d0515, #1a0a0a);
    cursor: url("data:image/svg+xml;utf8,<svg xmlns='http://www.w3.org/2000/svg' width='32' height='32' viewBox='0 0 32 32'><text y='24' font-size='24'>üíò</text></svg>") 16 16, auto;
  }

  /* ===== FLOATING HEARTS BG ===== */
  .hearts-bg {
    position: fixed; top: 0; left: 0;
    width: 100%; height: 100%;
    pointer-events: none; z-index: 0; overflow: hidden;
  }
  .floating-heart {
    position: absolute; bottom: -80px;
    animation: floatUp linear infinite;
    opacity: 0.15;
  }
  @keyframes floatUp {
    0% { transform: translateY(0) rotate(0deg) scale(1); opacity: 0; }
    10% { opacity: 0.15; }
    90% { opacity: 0.15; }
    100% { transform: translateY(-110vh) rotate(360deg) scale(0.5); opacity: 0; }
  }

  /* ===== SPARKLES ===== */
  .sparkle {
    position: fixed;
    background: #ff69b4; border-radius: 50%;
    pointer-events: none; z-index: 1;
    animation: sparkleAnim 3s ease-in-out infinite;
  }
  @keyframes sparkleAnim {
    0%, 100% { opacity: 0; transform: scale(0); }
    50% { opacity: 1; transform: scale(1); }
  }

  /* ===== ROSE PETALS ===== */
  .petal {
    position: fixed;
    background: radial-gradient(ellipse, #ff4466, #cc2244);
    border-radius: 50% 0 50% 50%;
    pointer-events: none; z-index: 0;
    animation: petalFall linear infinite;
  }
  @keyframes petalFall {
    0% { transform: translateY(-10vh) rotate(0deg) translateX(0); opacity: 0; }
    10% { opacity: 0.6; }
    90% { opacity: 0.6; }
    100% { transform: translateY(110vh) rotate(720deg) translateX(100px); opacity: 0; }
  }

  /* ===== SCREENS ===== */
  .screen {
    position: fixed; top: 0; left: 0;
    width: 100%; height: 100%;
    display: none;
    flex-direction: column;
    align-items: center; justify-content: center;
    z-index: 10;
  }
  .screen.active {
    display: flex;
    animation: screenIn 0.7s ease-out;
  }
  @keyframes screenIn {
    from { opacity: 0; transform: scale(0.85); }
    to { opacity: 1; transform: scale(1); }
  }

  /* ===== GRAFFITI BG ===== */
  .graffiti-bg {
    position: fixed; pointer-events: none; z-index: 2;
    font-family: 'Permanent Marker', cursive;
    opacity: 0.08; color: #ff69b4;
  }

  /* ===== QUESTION CARD ===== */
  .question-card {
    background: rgba(255,255,255,0.05);
    backdrop-filter: blur(20px);
    border: 1px solid rgba(255,105,180,0.2);
    border-radius: 30px;
    padding: 50px 60px; text-align: center;
    box-shadow: 0 0 40px rgba(255,20,147,0.15), 0 0 80px rgba(255,20,147,0.05),
      inset 0 0 40px rgba(255,105,180,0.03);
    animation: cardPulse 3s ease-in-out infinite, screenIn 1s ease-out;
    max-width: 600px; position: relative; z-index: 20;
  }
  @keyframes cardPulse {
    0%,100% { box-shadow: 0 0 40px rgba(255,20,147,0.15), 0 0 80px rgba(255,20,147,0.05); }
    50% { box-shadow: 0 0 60px rgba(255,20,147,0.25), 0 0 120px rgba(255,20,147,0.1); }
  }

  .heart-emoji-top {
    font-size: 4rem; display: block; margin-bottom: 10px;
    animation: heartBeat 1s ease-in-out infinite;
  }
  @keyframes heartBeat {
    0%,100% { transform: scale(1); }
    15% { transform: scale(1.3); }
    30% { transform: scale(1); }
    45% { transform: scale(1.2); }
    60% { transform: scale(1); }
  }

  .question-text {
    font-family: 'Dancing Script', cursive;
    font-size: 2.8rem; font-weight: 700;
    color: #fff; text-shadow: 0 0 20px rgba(255,105,180,0.5);
    margin-bottom: 10px; line-height: 1.3;
  }
  .question-text .name {
    color: #ff69b4; font-size: 3.2rem; display: block; margin-top: 5px;
    text-shadow: 0 0 20px rgba(255,105,180,0.8), 0 0 40px rgba(255,105,180,0.4);
    animation: nameGlow 2s ease-in-out infinite alternate;
  }
  @keyframes nameGlow {
    0% { text-shadow: 0 0 20px rgba(255,105,180,0.8), 0 0 40px rgba(255,105,180,0.4); }
    100% { text-shadow: 0 0 30px rgba(255,105,180,1), 0 0 60px rgba(255,105,180,0.6), 0 0 80px rgba(255,105,180,0.3); }
  }

  .subtitle {
    font-family: 'Caveat', cursive;
    font-size: 1.2rem; color: rgba(255,182,193,0.6); margin-bottom: 30px;
  }

  /* ===== BUTTONS CONTAINER ===== */
  .btn-container {
    display: flex; flex-direction: column; align-items: center;
    gap: 18px; margin-top: 20px;
  }

  /* ===== YES BUTTON ===== */
  .btn-yes {
    font-family: 'Dancing Script', cursive;
    font-size: 1.5rem; font-weight: 700;
    padding: 15px 50px; border: none; border-radius: 50px;
    background: linear-gradient(135deg, #ff1493, #ff69b4, #ff1493);
    background-size: 200% 200%;
    color: white; cursor: pointer;
    position: relative; overflow: hidden;
    transition: all 0.3s ease;
    box-shadow: 0 5px 25px rgba(255,20,147,0.4), 0 0 50px rgba(255,20,147,0.1);
    animation: bgShift 3s ease infinite;
    z-index: 20;
  }
  @keyframes bgShift {
    0%,100% { background-position: 0% 50%; }
    50% { background-position: 100% 50%; }
  }
  .btn-yes::before {
    content: ''; position: absolute;
    top: -2px; left: -2px; right: -2px; bottom: -2px;
    background: linear-gradient(45deg, #ff1493, #ff69b4, #ff1493, #ff69b4);
    background-size: 400% 400%; border-radius: 52px;
    z-index: -1; animation: bgShift 3s ease infinite;
    opacity: 0; transition: opacity 0.3s;
  }
  .btn-yes:hover::before { opacity: 1; }
  .btn-yes:hover {
    transform: scale(1.15) translateY(-3px);
    box-shadow: 0 10px 40px rgba(255,20,147,0.6), 0 0 80px rgba(255,20,147,0.2);
  }
  .btn-yes:active { transform: scale(0.95); }

  /* ===== NO BUTTON (starts inside card, then goes fixed) ===== */
  .btn-no-placeholder {
    font-family: 'Dancing Script', cursive;
    font-size: 1.3rem; font-weight: 700;
    padding: 13px 40px;
    border: 2px solid rgba(255,105,180,0.3);
    border-radius: 50px;
    background: rgba(255,255,255,0.05);
    color: rgba(255,182,193,0.7);
    cursor: pointer;
    user-select: none; white-space: nowrap;
    transition: all 0.2s;
    z-index: 20;
  }
  .btn-no-placeholder:hover {
    border-color: rgba(255,105,180,0.5);
  }

  .btn-no-fixed {
    font-family: 'Dancing Script', cursive;
    font-size: 1.3rem; font-weight: 700;
    padding: 13px 40px;
    border: 2px solid rgba(255,105,180,0.3);
    border-radius: 50px;
    background: rgba(255,255,255,0.05);
    color: rgba(255,182,193,0.7);
    cursor: pointer;
    position: fixed;
    z-index: 1000;
    user-select: none; white-space: nowrap;
    display: none;
  }

  /* ===== QUIRK MESSAGES ===== */
  .quirk-message {
    position: fixed; pointer-events: none; z-index: 999;
    font-family: 'Permanent Marker', cursive;
    animation: quirkAnim 2.5s ease-out forwards;
    white-space: nowrap;
  }
  @keyframes quirkAnim {
    0% { opacity: 1; transform: scale(0.3) translateY(0); }
    20% { opacity: 1; transform: scale(1.1) translateY(-10px); }
    100% { opacity: 0; transform: scale(0.8) translateY(-60px); }
  }

  /* ===== SCREEN 2 ===== */
  .sure-card {
    background: rgba(255,255,255,0.05);
    backdrop-filter: blur(20px);
    border: 1px solid rgba(255,105,180,0.2);
    border-radius: 30px; padding: 50px 60px; text-align: center;
    box-shadow: 0 0 40px rgba(255,20,147,0.15), 0 0 80px rgba(255,20,147,0.05);
    animation: screenIn 0.8s ease-out, cardPulse 3s ease-in-out infinite;
    max-width: 550px;
  }
  .sure-title {
    font-family: 'Dancing Script', cursive;
    font-size: 2.5rem; font-weight: 700; color: #fff;
    text-shadow: 0 0 20px rgba(255,105,180,0.5); margin-bottom: 30px;
  }
  .sure-btn-container { display: flex; gap: 25px; justify-content: center; flex-wrap: wrap; }

  .btn-sure-yes {
    font-family: 'Dancing Script', cursive;
    font-size: 1.4rem; font-weight: 700;
    padding: 15px 45px; border: none; border-radius: 50px;
    color: white; cursor: pointer; position: relative; overflow: hidden;
    transition: all 0.3s cubic-bezier(0.175,0.885,0.32,1.275);
  }
  .btn-sure-yes:nth-child(1) {
    background: linear-gradient(135deg, #ff1493, #e91e63);
    box-shadow: 0 5px 25px rgba(255,20,147,0.4);
  }
  .btn-sure-yes:nth-child(2) {
    background: linear-gradient(135deg, #e91e63, #c2185b);
    box-shadow: 0 5px 25px rgba(233,30,99,0.4);
  }
  .btn-sure-yes:hover {
    transform: scale(1.15) translateY(-5px) rotate(-2deg);
    box-shadow: 0 15px 40px rgba(255,20,147,0.5), 0 0 60px rgba(255,20,147,0.2);
  }
  .btn-sure-yes:nth-child(2):hover {
    transform: scale(1.15) translateY(-5px) rotate(2deg);
  }
  .btn-sure-yes::before {
    content: ''; position: absolute; top: 0; left: -100%;
    width: 100%; height: 100%;
    background: linear-gradient(90deg, transparent, rgba(255,255,255,0.3), transparent);
    transition: left 0.5s;
  }
  .btn-sure-yes:hover::before { left: 100%; }
  .btn-sure-yes:active { transform: scale(0.95); }

  /* ===== SCREEN 3: CELEBRATION ===== */
  #screen3 {
    background: radial-gradient(ellipse at center, rgba(50,0,20,0.95), rgba(15,5,10,0.98));
  }

  .graffiti-main {
    font-family: 'Permanent Marker', cursive;
    font-size: 4rem; color: transparent;
    -webkit-text-stroke: 2px #ff1493;
    text-shadow: 0 0 30px rgba(255,20,147,0.5);
    animation: graffitiGlow 2s ease-in-out infinite alternate;
    display: inline-block; text-align: center;
  }
  .graffiti-main span {
    display: inline-block;
    animation: letterDrop 0.6s ease-out backwards;
  }
  @keyframes letterDrop {
    0% { opacity: 0; transform: translateY(-80px) rotate(-20deg) scale(0); }
    60% { transform: translateY(10px) rotate(5deg) scale(1.1); }
    100% { opacity: 1; transform: translateY(0) rotate(0) scale(1); }
  }
  @keyframes graffitiGlow {
    0% { -webkit-text-stroke-color: #ff1493; text-shadow: 0 0 30px rgba(255,20,147,0.5); }
    50% { -webkit-text-stroke-color: #ff69b4; text-shadow: 0 0 50px rgba(255,105,180,0.8), 0 0 100px rgba(255,20,147,0.3); }
    100% { -webkit-text-stroke-color: #e91e63; text-shadow: 0 0 40px rgba(233,30,99,0.6); }
  }

  .graffiti-sub {
    font-family: 'Pacifico', cursive;
    font-size: 2rem; color: #ff69b4; margin-top: 15px;
    opacity: 0; animation: fadeUp 1s ease-out forwards; animation-delay: 1.5s;
  }
  .graffiti-sub2 {
    font-family: 'Caveat', cursive;
    font-size: 1.5rem; color: rgba(255,182,193,0.7); margin-top: 10px;
    opacity: 0; animation: fadeUp 1s ease-out forwards; animation-delay: 2.2s;
  }
  @keyframes fadeUp {
    from { opacity: 0; transform: translateY(30px); }
    to { opacity: 1; transform: translateY(0); }
  }

  /* ===== SPRAY DECOR ===== */
  .spray-decor {
    position: fixed; pointer-events: none; z-index: 12;
    font-family: 'Permanent Marker', cursive;
    opacity: 0; transform: scale(0);
  }
  .spray-decor.show {
    animation: sprayIn 0.8s ease-out forwards;
  }
  @keyframes sprayIn {
    0% { opacity: 0; transform: scale(0) rotate(-30deg); }
    60% { opacity: 0.6; transform: scale(1.2) rotate(5deg); }
    100% { opacity: 0.5; transform: scale(1) rotate(0deg); }
  }

  /* ===== BIG HEART OVERLAY ===== */
  .heart-overlay {
    position: fixed; top: 0; left: 0; width: 100%; height: 100%;
    display: none; align-items: center; justify-content: center;
    z-index: 500; pointer-events: none;
  }
  .heart-overlay.show {
    display: flex;
    animation: heartOverlayAnim 5s ease-in-out forwards;
  }
  @keyframes heartOverlayAnim {
    0% { opacity: 0; }
    15% { opacity: 1; }
    80% { opacity: 1; }
    100% { opacity: 0; }
  }

  .big-heart-wrap {
    position: relative; animation: bigBeat 0.6s ease-in-out infinite;
  }
  @keyframes bigBeat {
    0%,100% { transform: scale(1); }
    25% { transform: scale(1.12); }
    40% { transform: scale(1); }
    60% { transform: scale(1.08); }
  }

  .big-heart {
    width: 200px; height: 180px; position: relative;
  }
  .big-heart::before, .big-heart::after {
    content: ''; position: absolute;
    width: 100px; height: 160px;
    background: #ff1493; border-radius: 100px 100px 0 0;
    box-shadow: 0 0 40px rgba(255,20,147,0.5);
  }
  .big-heart::before {
    left: 100px; transform: rotate(-45deg); transform-origin: 0 100%;
  }
  .big-heart::after {
    left: 0; transform: rotate(45deg); transform-origin: 100% 100%;
  }

  .heart-text-inside {
    position: absolute; top: 45%; left: 50%;
    transform: translate(-50%, -50%);
    font-family: 'Dancing Script', cursive;
    font-size: 1.4rem; font-weight: 700;
    color: #fff; z-index: 510;
    white-space: nowrap;
    text-shadow: 0 2px 10px rgba(0,0,0,0.3);
  }

  /* ===== BURST HEARTS ===== */
  .burst-heart {
    position: fixed; pointer-events: none; z-index: 490;
    animation: burstOut 2s ease-out forwards;
  }
  @keyframes burstOut {
    0% { opacity: 1; transform: translate(0,0) scale(0.5) rotate(0deg); }
    100% { opacity: 0; transform: translate(var(--tx), var(--ty)) scale(1.5) rotate(var(--r)); }
  }

  /* ===== CONFETTI ===== */
  .confetti {
    position: fixed; top: -20px; pointer-events: none; z-index: 480;
    animation: confettiFall linear forwards;
  }
  @keyframes confettiFall {
    0% { opacity: 1; transform: translateY(0) rotate(0deg); }
    100% { opacity: 0; transform: translateY(110vh) rotate(720deg); }
  }

  /* ===== MUSIC TOGGLE ===== */
  .music-btn {
    position: fixed; top: 20px; right: 20px; z-index: 9999;
    background: rgba(255,255,255,0.08);
    border: 1px solid rgba(255,105,180,0.3);
    border-radius: 50%; width: 50px; height: 50px;
    display: flex; align-items: center; justify-content: center;
    cursor: pointer; font-size: 1.3rem;
    transition: all 0.3s; backdrop-filter: blur(10px);
  }
  .music-btn:hover {
    background: rgba(255,105,180,0.15);
    transform: scale(1.1);
    box-shadow: 0 0 20px rgba(255,20,147,0.3);
  }
  .music-btn.on { animation: mPulse 1s ease-in-out infinite; }
  @keyframes mPulse {
    0%,100% { box-shadow: 0 0 0 0 rgba(255,20,147,0.3); }
    50% { box-shadow: 0 0 0 10px rgba(255,20,147,0); }
  }

  /* ===== AUTOPLAY OVERLAY ===== */
  .tap-overlay {
    position: fixed; top: 0; left: 0; width: 100%; height: 100%;
    z-index: 99999;
    background: radial-gradient(ellipse, rgba(30,5,15,0.97), rgba(10,2,5,0.99));
    display: flex; flex-direction: column;
    align-items: center; justify-content: center;
    cursor: pointer;
    animation: overlayPulse 3s ease-in-out infinite;
  }
  @keyframes overlayPulse {
    0%,100% { background: radial-gradient(ellipse, rgba(30,5,15,0.97), rgba(10,2,5,0.99)); }
    50% { background: radial-gradient(ellipse, rgba(45,8,20,0.97), rgba(15,3,8,0.99)); }
  }
  .tap-overlay .tap-heart {
    font-size: 5rem;
    animation: heartBeat 1s ease-in-out infinite;
    margin-bottom: 20px;
  }
  .tap-overlay .tap-text {
    font-family: 'Dancing Script', cursive;
    font-size: 2rem; color: #ff69b4;
    text-shadow: 0 0 20px rgba(255,105,180,0.5);
    animation: fadeInOut 2s ease-in-out infinite;
  }
  .tap-overlay .tap-sub {
    font-family: 'Caveat', cursive;
    font-size: 1.1rem; color: rgba(255,182,193,0.4);
    margin-top: 10px;
  }
  @keyframes fadeInOut {
    0%,100% { opacity: 0.6; } 50% { opacity: 1; }
  }
  .tap-overlay.gone {
    animation: overlayFade 0.8s ease-out forwards;
    pointer-events: none;
  }
  @keyframes overlayFade {
    to { opacity: 0; }
  }

  /* ===== RESPONSIVE ===== */
  @media (max-width: 600px) {
    .question-text { font-size: 2rem; }
    .question-text .name { font-size: 2.3rem; }
    .question-card, .sure-card { padding: 35px 25px; margin: 0 15px; }
    .graffiti-main { font-size: 2.2rem; }
    .graffiti-sub { font-size: 1.3rem; }
    .big-heart { width: 140px; height: 130px; }
    .big-heart::before, .big-heart::after {
      width: 70px; height: 112px; border-radius: 70px 70px 0 0;
    }
    .big-heart::before { left: 70px; }
    .heart-text-inside { font-size: 1rem; }
    .tap-overlay .tap-text { font-size: 1.5rem; }
  }
</style>
</head>
<body>

<!-- ===== TAP TO START OVERLAY (needed for audio autoplay) ===== -->

<div class="spray-decor" id="sp6" style="top:58%;right:4%;font-size:2rem;color:#ff4081">‚ù§‚Äçüî• always</div>

<!-- Big Heart Overlay -->
<div class="heart-overlay" id="heartOverlay">
  <div class="big-heart-wrap">
    <div class="big-heart"></div>
    <div class="heart-text-inside">Nidhi ‚ô• Salil</div>
  </div>
</div>

<script>
(function() {
  "use strict";

  // ===== HELPERS =====
  function W() { return window.innerWidth; }
  function H() { return window.innerHeight; }
  function rand(a, b) { return a + Math.random() * (b - a); }
  function pick(arr) { return arr[Math.floor(Math.random() * arr.length)]; }

  var heartEmojis = ['üíï','üíñ','üíó','üíù','üíò','‚ù§Ô∏è','ü©∑','‚ô•','üíû','üíì'];

  // ================================================================
  //  MUSIC ENGINE ‚Äî single instance, proper on/off
  // ================================================================
  var audioCtx = null;
  var musicPlaying = false;
  var musicScheduled = false;  // prevents double-scheduling
  var melodyTimeout = null;
  var activeOscillators = [];  // track all oscillators so we can stop them

  function createAudioCtx() {
    if (!audioCtx) {
      audioCtx = new (window.AudioContext || window.webkitAudioContext)();
    }
    if (audioCtx.state === 'suspended') {
      audioCtx.resume();
    }
  }

  function scheduleNote(freq, startTime, duration, type, vol) {
    var osc = audioCtx.createOscillator();
    var g = audioCtx.createGain();
    osc.type = type || 'sine';
    osc.frequency.setValueAtTime(freq, startTime);
    g.gain.setValueAtTime(0, startTime);
    g.gain.linearRampToValueAtTime(vol || 0.04, startTime + 0.04);
    g.gain.setValueAtTime(vol || 0.04, startTime + duration - 0.08);
    g.gain.linearRampToValueAtTime(0, startTime + duration);
    osc.connect(g);
    g.connect(audioCtx.destination);
    osc.start(startTime);
    osc.stop(startTime + duration + 0.01);
    activeOscillators.push(osc);
    osc.onended = function() {
      var idx = activeOscillators.indexOf(osc);
      if (idx > -1) activeOscillators.splice(idx, 1);
    };
  }

  function playMelodyLoop() {
    if (!musicPlaying || !audioCtx) return;
    musicScheduled = true;

    var now = audioCtx.currentTime + 0.05;
    var t = 0.42; // tempo (seconds per beat)

    // Melody
    var mel = [
      [523,0,2],[587,2,1],[659,3,2],[587,5,1],[523,6,2],
      [494,8,1],[440,9,2],[392,11,1],[440,12,2],[523,14,1],
      [494,15,2],[440,17,1],[392,18,2],[349,20,1],[330,21,2],
      [349,23,1],[392,24,2],[440,26,1],[494,27,1],[523,28,3],[440,31,1]
    ];
    mel.forEach(function(n) {
      scheduleNote(n[0], now + n[1]*t, n[2]*t, 'sine', 0.045);
      scheduleNote(n[0]*2, now + n[1]*t, n[2]*t, 'sine', 0.012); // harmonic
    });

    // Chords
    var chords = [
      [[262,330,392],0,8],[[220,262,330],8,4],
      [[247,311,370],12,4],[[262,330,392],16,4],
      [[220,262,330],20,4],[[196,247,294],24,4],
      [[262,330,392],28,4]
    ];
    chords.forEach(function(ch) {
      ch[0].forEach(function(f) {
        scheduleNote(f, now + ch[1]*t, ch[2]*t, 'triangle', 0.016);
      });
    });

    var loopMs = 32 * t * 1000;
    melodyTimeout = setTimeout(function() {
      musicScheduled = false;
      if (musicPlaying) playMelodyLoop();
    }, loopMs);
  }

  function startMusic() {
    if (musicPlaying) return; // prevent double start
    musicPlaying = true;
    // createAudioCtx();
    // playMelodyLoop();
    document.getElementById('customMusic').play();
    document.getElementById('musicBtn').textContent = 'üéµ';
    document.getElementById('musicBtn').classList.add('on');
  }

  function stopMusic() {
    musicPlaying = false;
    // musicScheduled = false;
    // clearTimeout(melodyTimeout);
    // Stop all currently playing oscillators
    // activeOscillators.forEach(function(osc) {
    //   try { osc.stop(); } catch(e) {}
    // });
    // activeOscillators = [];
    document.getElementById('customMusic').pause();
    document.getElementById('musicBtn').textContent = 'üîá';
    document.getElementById('musicBtn').classList.remove('on');
  }

  document.getElementById('musicBtn').addEventListener('click', function(e) {
    e.stopPropagation();
    if (musicPlaying) {
      stopMusic();
    } else {
      startMusic();
    }
  });

  // ================================================================
  //  TAP-TO-START OVERLAY (enables audio + starts music)
  // ================================================================
  var tapOverlay = document.getElementById('tapOverlay');
  tapOverlay.addEventListener('click', function() {
    tapOverlay.classList.add('gone');
    setTimeout(function() { tapOverlay.style.display = 'none'; }, 900);
    startMusic();
  });
  tapOverlay.addEventListener('touchstart', function() {
    tapOverlay.classList.add('gone');
    setTimeout(function() { tapOverlay.style.display = 'none'; }, 900);
    startMusic();
  });

  // ================================================================
  //  BACKGROUND PARTICLES
  // ================================================================
  var heartsBg = document.getElementById('heartsBg');

  function makeFloatingHeart() {
    var el = document.createElement('div');
    el.className = 'floating-heart';
    el.textContent = pick(heartEmojis);
    el.style.left = rand(0,100) + '%';
    el.style.fontSize = rand(15,40) + 'px';
    el.style.animationDuration = rand(8,18) + 's';
    el.style.animationDelay = rand(0,2) + 's';
    heartsBg.appendChild(el);
    setTimeout(function() { el.remove(); }, 22000);
  }
  setInterval(makeFloatingHeart, 900);
  for (var i = 0; i < 12; i++) setTimeout(makeFloatingHeart, i*250);

  function makeSparkle() {
    var el = document.createElement('div');
    el.className = 'sparkle';
    el.style.left = rand(0,100) + '%';
    el.style.top = rand(0,100) + '%';
    el.style.animationDelay = rand(0,3) + 's';
    var s = rand(2,5);
    el.style.width = s+'px'; el.style.height = s+'px';
    el.style.background = pick(['#ff69b4','#ff1493','#ff80ab','#fff','#ffc1e3']);
    document.body.appendChild(el);
    setTimeout(function() { el.remove(); }, 6000);
  }
  setInterval(makeSparkle, 500);
  for (var i = 0; i < 15; i++) setTimeout(makeSparkle, i*200);

  function makePetal() {
    var el = document.createElement('div');
    el.className = 'petal';
    el.style.left = rand(0,100) + '%';
    el.style.animationDuration = rand(6,14) + 's';
    el.style.animationDelay = rand(0,3) + 's';
    var s = rand(8,18);
    el.style.width = s+'px'; el.style.height = s+'px';
    document.body.appendChild(el);
    setTimeout(function() { el.remove(); }, 18000);
  }
  setInterval(makePetal, 1400);
  for (var i = 0; i < 6; i++) setTimeout(makePetal, i*400);

  // ================================================================
  //  NO BUTTON LOGIC
  // ================================================================
  var noBtnPlaceholder = document.getElementById('noBtnPlaceholder');
  var noBtnFixed = document.getElementById('noBtnFixed');
  var noEscaped = false;    // has the No button left the card yet?
  var noVisible = true;     // is the No button still on screen?
  var noBtnX = 0;
  var noBtnY = 0;
  var runCount = 0;
  var quipInterval = null;  // timed quip spawner
  var mouseX = 0;
  var mouseY = 0;

  var quirks = [
    { t: "Haha! üòú", c: "#ff69b4" },
    { t: "Catch me if you can! üèÉ", c: "#ff1493" },
    { t: "Not so fast! üí®", c: "#e91e63" },
    { t: "You can't click me! üòè", c: "#ff80ab" },
    { t: "Try again! ü§™", c: "#f50057" },
    { t: "Nope! üôà", c: "#ff4081" },
    { t: "Just say Yes! üíï", c: "#ff69b4" },
    { t: "I'm too quick! ‚ö°", c: "#ff1493" },
    { t: "Wrong button! ‚û°Ô∏è", c: "#e91e63" },
    { t: "Hehe~ ü§≠", c: "#ff80ab" },
    { t: "Nice try! üòÇ", c: "#f50057" },
    { t: "Click the other one! üíó", c: "#ff4081" },
    { t: "I believe in you! ü•∞", c: "#ff69b4" },
    { t: "Slippery! üßº", c: "#ff1493" },
    { t: "Almost! üòù", c: "#e91e63" },
    { t: "The Yes button is lonely! üíñ", c: "#ff80ab" },
    { t: "You know you want Yes! üíû", c: "#f50057" },
    { t: "Too slow! üê¢", c: "#ff4081" },
    { t: "Wheee! üé¢", c: "#ff69b4" },
    { t: "Over here! Psych! üòú", c: "#ff1493" }
  ];

  function spawnQuirk(x, y) {
    var q = pick(quirks);
    var el = document.createElement('div');
    el.className = 'quirk-message';
    el.textContent = q.t;
    el.style.left = (x + rand(-50, 50)) + 'px';
    el.style.top = (y + rand(-25, 15)) + 'px';
    el.style.color = q.c;
    el.style.fontSize = rand(0.9, 1.4) + 'rem';
    el.style.textShadow = '0 0 10px ' + q.c + '66';
    document.body.appendChild(el);
    setTimeout(function() { el.remove(); }, 3000);
  }

  function positionNoBtn() {
    noBtnFixed.style.left = noBtnX + 'px';
    noBtnFixed.style.top = noBtnY + 'px';
  }

  // First hover on placeholder ‚Üí escape!
  function escapeNoButton() {
    if (noEscaped) return;
    noEscaped = true;

    // Get placeholder position to start from there
    var rect = noBtnPlaceholder.getBoundingClientRect();
    var cx = rect.left + rect.width/2;
    var cy = rect.top + rect.height/2;

    // Spawn first quirk at starting position
    spawnQuirk(cx, cy);

    // Hide placeholder, show fixed button
    noBtnPlaceholder.style.visibility = 'hidden';
    noBtnFixed.style.display = 'block';

    // Jump to a random position away from center
    var pad = 80;
    noBtnX = rand(pad, W() - 200);
    noBtnY = rand(pad, H() - 80);
    positionNoBtn();

    runCount++;

    // Start the timed quip spawner (every 2-3 seconds)
    startQuipTimer();
  }

  function runAway() {
    if (!noVisible) return;

    if (!noEscaped) {
      escapeNoButton();
      return;
    }

    var rect = noBtnFixed.getBoundingClientRect();
    var cx = rect.left + rect.width/2;
    var cy = rect.top + rect.height/2;

    // Spawn quirk at the position it's leaving
    spawnQuirk(cx, cy);

    // Find a new position far from current
    var pad = 60;
    var tries = 0;
    var newX, newY;
    do {
      newX = rand(pad, W() - rect.width - pad);
      newY = rand(pad, H() - rect.height - pad);
      tries++;
    } while (Math.hypot(newX - noBtnX, newY - noBtnY) < 200 && tries < 30);

    noBtnX = newX;
    noBtnY = newY;
    positionNoBtn();

    runCount++;

    // Shrink after many attempts
    if (runCount > 6) {
      var sc = Math.max(0.4, 1 - (runCount - 6) * 0.06);
      noBtnFixed.style.transform = 'scale(' + sc + ')';
      noBtnFixed.style.opacity = Math.max(0.25, 1 - (runCount - 6) * 0.06);
    }
    if (runCount === 8) noBtnFixed.textContent = "Give up? üòÖ";
    if (runCount === 12) noBtnFixed.textContent = "Just say Yes! ü•∫";
    if (runCount === 16) noBtnFixed.textContent = "Please? üôè";
    if (runCount === 20) noBtnFixed.textContent = "I'm vanishing... üëª";
  }

  // ===== TIMED QUIP SPAWNER (every 2-3 seconds while running) =====
  function startQuipTimer() {
    if (quipInterval) return;
    quipInterval = setInterval(function() {
      if (!noVisible || !noEscaped) {
        clearInterval(quipInterval);
        quipInterval = null;
        return;
      }
      var rect = noBtnFixed.getBoundingClientRect();
      if (rect.width === 0) return;
      var cx = rect.left + rect.width/2;
      var cy = rect.top + rect.height/2;
      spawnQuirk(cx, cy);
    }, rand(2000, 3000));
  }

  // Event listeners for placeholder (first interaction)
  noBtnPlaceholder.addEventListener('mouseenter', escapeNoButton);
  noBtnPlaceholder.addEventListener('touchstart', function(e) { e.preventDefault(); escapeNoButton(); });
  noBtnPlaceholder.addEventListener('click', function(e) { e.preventDefault(); escapeNoButton(); });

  // Event listeners for the fixed running button
  noBtnFixed.addEventListener('mouseenter', runAway);
  noBtnFixed.addEventListener('touchstart', function(e) { e.preventDefault(); runAway(); });
  noBtnFixed.addEventListener('click', function(e) { e.preventDefault(); runAway(); });

  // Track mouse for magnetic repulsion
  document.addEventListener('mousemove', function(e) {
    mouseX = e.clientX;
    mouseY = e.clientY;

    if (!noVisible || !noEscaped) return;

    var rect = noBtnFixed.getBoundingClientRect();
    if (rect.width === 0) return;
    var cx = rect.left + rect.width/2;
    var cy = rect.top + rect.height/2;
    var dx = cx - e.clientX;
    var dy = cy - e.clientY;
    var dist = Math.hypot(dx, dy);

    if (dist < 160) {
      var angle = Math.atan2(dy, dx);
      var force = (160 - dist) * 0.45;
      var nx = noBtnX + Math.cos(angle) * force;
      var ny = noBtnY + Math.sin(angle) * force;

      nx = Math.max(10, Math.min(W() - rect.width - 10, nx));
      ny = Math.max(10, Math.min(H() - rect.height - 10, ny));

      noBtnX = nx;
      noBtnY = ny;
      positionNoBtn();
    }
  });

  // ================================================================
  //  SCREEN TRANSITIONS
  // ================================================================
  function showScreen(id) {
    document.querySelectorAll('.screen').forEach(function(s) {
      s.classList.remove('active');
    });
    document.getElementById(id).classList.add('active');
  }

  // YES ‚Üí Screen 2
  document.getElementById('yesBtn1').addEventListener('click', function() {
    var rect = this.getBoundingClientRect();
    burstHearts(rect.left + rect.width/2, rect.top + rect.height/2, 12);

    // Hide no button
    noBtnPlaceholder.style.display = 'none';
    noBtnFixed.style.display = 'none';
    noVisible = false;
    clearInterval(quipInterval);
    quipInterval = null;

    document.getElementById('graffitiBgGroup').style.display = 'none';

    setTimeout(function() { showScreen('screen2'); }, 400);
  });

  // Sure buttons ‚Üí Screen 3
  document.getElementById('sureBtn1').addEventListener('click', function() {
    burstHearts(W()/2, H()/2, 14);
    setTimeout(function() { showScreen('screen3'); celebrate(); }, 500);
  });
  document.getElementById('sureBtn2').addEventListener('click', function() {
    burstHearts(W()/2, H()/2, 14);
    setTimeout(function() { showScreen('screen3'); celebrate(); }, 500);
  });

  // ================================================================
  //  CELEBRATION
  // ================================================================
  var celebrated = false;

  function celebrate() {
    if (celebrated) return;
    celebrated = true;

    // Spray decorations
    for (var i = 1; i <= 6; i++) {
      (function(n) {
        setTimeout(function() {
          document.getElementById('sp' + n).classList.add('show');
        }, 300 + n * 350);
      })(i);
    }

    // Graffiti text letter by letter
    var box = document.getElementById('celebrationBox');
    var mainDiv = document.createElement('div');
    mainDiv.className = 'graffiti-main';
    var text = "You're My Valentine!";
    text.split('').forEach(function(ch, idx) {
      var span = document.createElement('span');
      span.textContent = (ch === ' ') ? '\u00A0' : ch;
      span.style.animationDelay = (0.3 + idx * 0.06) + 's';
      mainDiv.appendChild(span);
    });
    // Add heart emoji as last "letter"
    var heartSpan = document.createElement('span');
    heartSpan.textContent = ' üíñ';
    heartSpan.style.animationDelay = (0.3 + text.length * 0.06) + 's';
    mainDiv.appendChild(heartSpan);
    box.appendChild(mainDiv);

    var sub1 = document.createElement('div');
    sub1.className = 'graffiti-sub';
    sub1.textContent = "I knew you'd say yes, Nidhi! ü•∞";
    box.appendChild(sub1);

    var sub2 = document.createElement('div');
    sub2.className = 'graffiti-sub2';
    sub2.textContent = '~ This is going to be the best Valentine\'s Day ever ~';
    box.appendChild(sub2);

    // Confetti
    launchConfetti();
    setTimeout(launchConfetti, 2200);
    setTimeout(launchConfetti, 4800);

    // Heart bursts
    setTimeout(function() { burstHearts(W()/2, H()/2, 25); }, 800);
    setTimeout(function() { burstHearts(W()/2, H()/2, 18); }, 2800);

    // Big heart
    setTimeout(function() {
      var overlay = document.getElementById('heartOverlay');
      overlay.classList.add('show');
      burstHearts(W()/2, H()/2, 35);
      setTimeout(function() {
        overlay.classList.remove('show');
        overlay.style.display = 'none';
        burstHearts(W()/2, H()/2, 20);
      }, 5200);
    }, 3500);
  }

  // ================================================================
  //  EFFECTS
  // ================================================================
  function burstHearts(cx, cy, count) {
    for (var i = 0; i < count; i++) {
      (function(idx) {
        var el = document.createElement('div');
        el.className = 'burst-heart';
        el.textContent = pick(heartEmojis);
        var angle = (Math.PI*2/count)*idx + rand(-0.3, 0.3);
        var dist = rand(80, 300);
        el.style.left = cx + 'px';
        el.style.top = cy + 'px';
        el.style.fontSize = rand(1.2, 2.5) + 'rem';
        el.style.setProperty('--tx', Math.cos(angle)*dist + 'px');
        el.style.setProperty('--ty', Math.sin(angle)*dist + 'px');
        el.style.setProperty('--r', rand(-180,180) + 'deg');
        el.style.animationDelay = rand(0, 0.3) + 's';
        el.style.animationDuration = rand(1.5, 2.5) + 's';
        document.body.appendChild(el);
        setTimeout(function() { el.remove(); }, 3500);
      })(i);
    }
  }

  function launchConfetti() {
    var colors = ['#ff1493','#ff69b4','#ff80ab','#e91e63','#f50057','#ff4081','#ffc1e3','#fff','#ffb6c1','#ff6b6b'];
    for (var i = 0; i < 55; i++) {
      (function() {
        var el = document.createElement('div');
        el.className = 'confetti';
        var size = rand(5, 14);
        el.style.left = rand(0,100) + '%';
        el.style.width = size + 'px';
        el.style.height = size * rand(0.4, 1.2) + 'px';
        el.style.background = pick(colors);
        el.style.borderRadius = pick(['50%','0','30%']);
        el.style.animationDuration = rand(2, 4.5) + 's';
        el.style.animationDelay = rand(0, 1.5) + 's';
        el.style.opacity = rand(0.5, 1);
        document.body.appendChild(el);
        setTimeout(function() { el.remove(); }, 7000);
      })();
    }
  }

  // ===== RESIZE HANDLER =====
  window.addEventListener('resize', function() {
    if (noEscaped && noVisible) {
      noBtnX = Math.max(10, Math.min(noBtnX, W() - 160));
      noBtnY = Math.max(10, Math.min(noBtnY, H() - 60));
      positionNoBtn();
    }
  });

})();
</script>
